def mapper(code):
	return str(code)+'u'

SDF_DATA = ', '.join(map(mapper, packed_sdfs)) 
NUM_SDFS = len(packed_sdfs)

glsl =  string.Template('''

	#define ORIG_X ${ORIG_X}
	#define ORIG_Y ${ORIG_Y}
	#define ORIG_Z ${ORIG_Z}

	#define EDGE_X ${EDGE_X}
	#define EDGE_Y ${EDGE_Y}
	#define EDGE_Z ${EDGE_Z}

	#define RES_X ${RES_X}u
	#define RES_Y ${RES_Y}u
	#define RES_Z ${RES_Z}u

	#define VOXEL_SIZE ${VOXEL_SIZE}
	#define SDF_ABSMAX ${SDF_ABSMAX}

	const uint packed_sdfs[${NUM_SDFS}] = uint[${NUM_SDFS}]( ${SDF_DATA} );

	float sdBox(vec3 X, vec3 bmin, vec3 bmax)                     
	{                            
	    vec3 d = abs(X-0.5*(bmin+bmax)) - 0.5*(bmax-bmin);
	    return min(max(d.x,max(d.y,d.z)),0.0) + length(max(d,0.0));     
	} 

	void worldToVoxel(in vec3 wsP, in vec3 origin, 
	                   inout uint x, inout uint y, inout uint z)
	{
	    vec3 vsP = (wsP - vec3(ORIG_X, ORIG_Y, ORIG_Z)) / VOXEL_SIZE;
	    x = min(RES_X-1u, uint(vsP.x));
	    y = min(RES_Y-1u, uint(vsP.y));
	    z = min(RES_Z-1u, uint(vsP.z));
	}

	float getSDF(uint x, uint y, uint z)
	{
		uint sdf_index = z + (RES_Z+1u)*(y + (RES_Y+1u)*x);
		uint packed_sdfs_index = sdf_index/4u;
		uint byte = sdf_index - packed_sdfs_index*4u;
		uint packed_sdf = packed_sdfs[packed_sdfs_index];
		uint sdf_int = (packed_sdf >> 8u*(3u-byte)) & 255u;
		float sdf = SDF_ABSMAX * (float(sdf_int) - 127.5) / 127.5;
		return sdf;
	}

	float MESH(in vec3 X)
	{
		vec3 O = vec3(ORIG_X, ORIG_Y, ORIG_Z);
		vec3 E = vec3(EDGE_X, EDGE_Y, EDGE_Z);
		
		// if X is outside grid, return distance to a slightly embedded grid
		if ( sdBox(X, O, O+E) > 0.0 )
		{
			return sdBox(X, O+0.01*E, O+0.99*E);
		}
		
		// Get voxel containing point
		uint x, y, z;
		worldToVoxel(X, O, x, y, z);

		vec3 C = O + VOXEL_SIZE*vec3(float(x), float(y), float(z));
		vec3 f2 = (X - C)/VOXEL_SIZE;
		vec3 f1 = vec3(1.0) - f2;

	    uint xp = x+1u;
	    uint yp = y+1u;
	    uint zp = z+1u;

	    float mmm = getSDF(x,  y,  z); 
	    float pmm = getSDF(xp, y,  z); 
	    float mpm = getSDF(x,  yp, z); 
	    float ppm = getSDF(xp, yp, z); 
	    float mmp = getSDF(x,  y,  zp);
	    float pmp = getSDF(xp, y,  zp);
	    float mpp = getSDF(x,  yp, zp);
	    float ppp = getSDF(xp, yp, zp);

	    return ( f1.x * (f1.y*(f1.z*mmm + f2.z*mmp)  +
	                     f2.y*(f1.z*mpm + f2.z*mpp)) +
	             f2.x * (f1.y*(f1.z*pmm + f2.z*pmp)  +
	                     f2.y*(f1.z*ppm + f2.z*ppp)) );
	}
''').safe_substitute( {'ORIG_X': grid_origin[0],
					   'ORIG_Y': grid_origin[1],
					   'ORIG_Z': grid_origin[2],
					   'EDGE_X': voxel_size * voxel_resolution[0],
					   'EDGE_Y': voxel_size * voxel_resolution[1],
					   'EDGE_Z': voxel_size * voxel_resolution[2],
					   'RES_X': voxel_resolution[0],
					   'RES_Y': voxel_resolution[1],
					   'RES_Z': voxel_resolution[2],
					   'VOXEL_SIZE': voxel_size,
					   'SDF_DATA': SDF_DATA,
					   'SDF_ABSMAX': sdf_absmax,
					   'NUM_SDFS': NUM_SDFS
	                      } )

